import React from 'react';
import styles from './home.module.css';

const Home = (props) => {

    return(
        <div className={styles.background}>
            
            <img className={styles.background_image} src="/images/twitter.svg" alt="twitter_logo"/>
        </div>
    
    )
};

export default Home;
